public void swap(int[] data, int i, int j){ 
  int t = data[i]; 
  data[i] = data[j]; 
  data[j] = t; 
}
public void sort(int[] list){
  int j; 
  int temp; 
  boolean done; 
  for(int i = 1; i < list.length; i++){ 
    temp = list[i]; 
    j = i; 
    done = temp <= list[j - 1]; 
    // line A 
    while( !done ){  
      swap(list, j, j - 1); 
      j--; 
      done = j == 0 || temp <= list[j - 1];
    } 
  } 
}

